import './App.css';

import { NavBar } from './components/navigationBar';
import { Banner } from './components/banner';
import { Skills } from './components/skills';

import 'bootstrap/dist/css/bootstrap.min.css'


function App() {
  return (
    <div className="App">
      <NavBar />
      <Banner />
      <Skills />
      <Skills />
    </div>
  );
}

export default App;
